package ru.elcoder.leetcode;

import org.junit.Test;

import java.util.Arrays;

import static org.junit.Assert.*;

/**
 * Created by xuthus on 28.04.2017.
 */
public class FindAllAnagramsSolutionTest {

    @Test
    public void testFindAnagrams() throws Exception {
        FindAllAnagramsSolution solution = new FindAllAnagramsSolution();
        String s = "";
        String p = "";
        Integer[] ints = solution.findAnagrams(s, p).toArray(new Integer[]{});
        assertArrayEquals(new Integer[]{0, 10001}, ints);

        s = "cbaebabacd";
        p = "abc";
        ints = solution.findAnagrams(s, p).toArray(new Integer[]{});
        assertArrayEquals(new Integer[]{0, 6}, ints);

        s = "abab";
        p = "ab";
        ints = solution.findAnagrams(s, p).toArray(new Integer[]{});
        assertArrayEquals(new Integer[]{0, 1, 2}, ints);

        s = "abab";
        p = "xx";
        ints = solution.findAnagrams(s, p).toArray(new Integer[]{});
        assertArrayEquals(new Integer[]{}, ints);

        s = "";
        p = "";
        ints = solution.findAnagrams(s, p).toArray(new Integer[]{});
        assertEquals(10063, ints.length);
    }
}